import "./home.css";

const HomePage = () => {
  return (
    <main className="home-container">
      <div className="home-header">User List</div>
      <div className="content-box">
        <div className="text-box">
        <h1>Sảnh sự kiện</h1>
        <p>Chín sảnh tiệc được đặt theo tên những dòng sông huyền thoại trên thế giới như Seine, Nile, Volga, Thames, Danube, Amur, Elbe và có thể thông nhau phục vụ cùng lúc 4.500...</p>
        </div>
        <img src="https://riversidepalace.vn/multidata/_mg_1690-hdr.jpg" className="content-img" alt="img1"/>
      </div>
    </main>
  );
};

export default HomePage;
